import React from 'react';
//import './MainPage.css';
import ResponsiveDrawer from "./Nav.jsx"
import {makeStyles} from "@material-ui/core";
import bg from "../images/bg3.png";


const useStyles = makeStyles(theme => ({
    content:{
        flexGrow: 1,
        padding: theme.spacing(3),
        fontSize: 20,
        backgroundImage: `url(${bg})`,
        backgroundRepeat: "no-repeat",
        backgroundSize: "cover",
        backgroundAttachment: "fixed",
        height: "100%"
    },
    des:{
        color:"white",
        fontFamily:"Comic Sans MS",
        align:'center',
        [theme.breakpoints.up('xs')]: {
            marginLeft: 5,
        },
        [theme.breakpoints.up('sm')]: {
            marginLeft: 250,
        },
        [theme.breakpoints.up('lg')]: {
            marginLeft: 250,
        }

    }

}));



const Project = () => {
    const classes = useStyles();
    return(
        <main className={classes.content}>
            <ResponsiveDrawer/>
            <div className={classes.des}>
                <h2>  Here's what I've done so far. </h2>
                <h2> Education </h2>
                <h2> Projects </h2>
                <p>
                    A web application that help non profit organization, Action Against Hunger Canada,
                    educate and connect students with nutrient science across the world.
                    It's implemented using Angular2, node.js, firebase(cloud database).
                    This application create a communication platform that engage students with the knowledge of nutrient.
                </p>

                <p>
                    Development of K-mer Based Alignment-free Pipeline and its database  at Public Health Ontario.
                    The project that I am working on has two main parts. One part is to build PostgreSQL databases based on bacteria â€™s taxonamy
                    and kmer. The other part is to develop a K-mer based alignment-free Metagenomics pipeline to
                    rapidly identify different taxonomic units of bacteria and viruses. The pipeline will be implemented in a
                    parallel processing environment by using open-source programs and web-based visualizing tools will also
                    be created.
                </p>
            </div>
        </main>

    );
}

export default Project;
